        combo = $('<select class="mtz-monthpicker mtz-monthpicker-year" />'),
        table = $('<table class="mtz-monthpicker" />'),
        tbody = $('<tbody class="mtz-monthpicker" />'),
        tr = $('<tr class="mtz-monthpicker" />'),
        td = '',
